body.script:
$(document).ready(function(){
  var wh = window.innerHeight;
  var ww = window.innerWidth;
  if (ww > 767){
      var imagesCount = Math.ceil(Math.ceil(ww/182)/2)*2+1;
      var imagesCount2 = (Math.ceil(Math.ceil(ww/182)/2)*2-2)/2;
      var imagesWidth = imagesCount * 182;
      var imagesMargin = 0 - (ww - imagesWidth)/2;
  } else {
      var imagesCount = Math.ceil(Math.ceil(ww/90)/2)*2+1;
      var imagesCount2 = (Math.ceil(Math.ceil(ww/90)/2)*2-2)/2;
      var imagesWidth = imagesCount * 90;
      var imagesMargin = 0 - (ww - imagesWidth)/2;
  }
  $('.top-images').css({'margin-left':'-'+imagesMargin+'px'});
  $('.content .top-images ul.zero-row').prepend('
');
  for (var i = 1; i <= imagesCount; i++){
      $('.content .top-images ul.zero-row').prepend('
');
      $('.content .top-images ul.first-row').prepend('
');
  }
  for (var i = 1; i <= imagesCount2; i++){
      $('.content .top-images ul.second-row').prepend('
');
  }
  $('.content .top-images ul.second-row').prepend('
');
  $('.content .top-images ul.second-row').prepend('
');
  $('.content .top-images ul.second-row').prepend('
');
  for (var i = 1; i <= imagesCount2; i++){
      $('.content .top-images ul.second-row').prepend('
');
  }
});
